import{_ as e,c as a,o as s,a as o}from"./app.8a15cda7.js";const m=JSON.parse('{"title":"\xBFQu\xE9 escoger del huevo?","description":"","frontmatter":{},"headers":[{"level":3,"title":"IMPORTANTE:","slug":"importante","link":"#importante","children":[]},{"level":3,"title":"RESUMEN:","slug":"resumen","link":"#resumen","children":[]},{"level":3,"title":"POR LO TANTO:","slug":"por-lo-tanto","link":"#por-lo-tanto","children":[]},{"level":3,"title":"NOTA:","slug":"nota","link":"#nota","children":[]}],"relativePath":"faq/es/40.md","lastUpdated":1670678328000}'),r={name:"faq/es/40.md"},t=o('<h1 id="\xBFque-escoger-del-huevo" tabindex="-1">\xBFQu\xE9 escoger del huevo? <a class="header-anchor" href="#\xBFque-escoger-del-huevo" aria-hidden="true">#</a></h1><p>tags: huevo</p><h3 id="importante" tabindex="-1">IMPORTANTE: <a class="header-anchor" href="#importante" aria-hidden="true">#</a></h3><p>Antes de escoger una Valkyrie del selector de valkyrie rango S o de Land of Wishes, ESPERA hasta conseguir las dos primeras valks rango S garantizadas del dorm supply (Garantizadas tras 25 pulls). Las valks que consigas de dorm supply afectar\xE1n la valkyrie que escoger\xE1s del huevo.</p><h3 id="resumen" tabindex="-1">RESUMEN: <a class="header-anchor" href="#resumen" aria-hidden="true">#</a></h3><p>Existen 3 valkyries que debes conseguir lo mas pronto posible: KMB, LE y PX. Tienes 3 selectores. Si es necesario, usar\xE1s estos 3 selectores para escoger a esas 3 valkyries. Sin embargo, si consigues alguna de esas valks del dorm supply es posible escoger otra valk del primer selector (gratuito). Puedes escoger SK si es el caso.</p><h3 id="por-lo-tanto" tabindex="-1">POR LO TANTO: <a class="header-anchor" href="#por-lo-tanto" aria-hidden="true">#</a></h3><ol><li><p>Si no conseguiste ninguna de las valks mencionadas en dorm supply... Selector gratuito: KMB Land of Wishes 1: LE Land of Wishes 2: PX</p></li><li><p>Si conseguiste LE/SS del dorm supply... Selector gratuito: SK Land of Wishes 1: LE/KMB (La que te falte, dupe de LE si tienes ambas.) Land of Wishes 2: PX</p></li><li><p>Si conseguiste PX pero no LE/KMB del dorm supply Selector gratuito: KMB Land of Wishes 1: LE Land of Wishes 2: (Leer la nota adjunta)</p></li></ol><h3 id="nota" tabindex="-1">NOTA: <a class="header-anchor" href="#nota" aria-hidden="true">#</a></h3><p>Si consigues a PX del dorm supply, puedes posponer el segundo Land of Wishes.</p>',10),i=[t];function l(n,d,c,p,u,h){return s(),a("div",null,i)}const _=e(r,[["render",l]]);export{m as __pageData,_ as default};
